export const deleteMark=(a, b, c ,d)=>{
    let m1 = '+';
    let m2 = '+';
    if(b.substr(0,1) === '-'){
        m1 = '-'
    }
    if(d.substr(0,1) === '-'){
        m2 = '-'
    }
    return [m1, m2]
};
